package com.webauthn4j.util.jws;

import com.webauthn4j.converter.util.JsonConverter;
import com.webauthn4j.converter.util.ObjectConverterFactory;
import org.junit.jupiter.api.Test;

import java.util.HashMap;

import static org.assertj.core.api.Assertions.assertThat;
import static org.junit.jupiter.api.Assertions.assertThrows;

class JWSTest {

    @Test
    void isValidSignature_with_invalid_data_test() {
        String input = "..iS1Oh6KXyU87QReMiWRilVlYzxv9Tfk0DgyNM2l2WWa1wzNiVJk9q2bxFP6EKxLA71FvCgfurAZx1Lelp3vmJw";
        JWS jws = JWS.parse(input, ObjectConverterFactory.getJsonConverter(), HashMap.class);
        assertThat(jws.isValidSignature()).isFalse();
    }

    @Test
    void parse_invalid_data_test() {
        String input = "invalid";
        assertThrows(IllegalArgumentException.class,
                () -> JWS.parse(input, ObjectConverterFactory.getJsonConverter(), HashMap.class)
        );
    }
}